  \"2013-03-20T14:47:47.819477\",\n\t\"name\": \"alabama-aqueous-well-chemistry\",\n\t\"isopen\":
  true,\n\t\"url\": null,\n\t\"notes\": \"These data contains aqueous well chemistry
  information compiled by the Geological Survey of Alabama, and published as a Web
  feature service for the National Geothermal Data System. Fields in the Aqueous Chemistry
  Content Model will become XML elements in interchange documents for WMS simple features
  provided by a node in the USGIN network.  Each chemistry analysis includes a fluid
  temperature, source/citation, latitude and longitude referenced to EPSG:4326 (for
  interoperability).  The data contained in the submitted dataset(s) are available
  as Excel Spreadsheets, ESRI service, WMS and WFS services.For more information see
  links provided. \",\n\t\"license_title\": \"Creative Commons Attribution\",\n\t\"extras\":
